import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom'; // Добавляем для использования вместо обычных ссылок
import logo from '../../Image/logo.png'; 
import basket from '../../Image/basket.svg'; 
import "./Header.css";

const MainHeader = () => {
  return (
    <Navbar className="bg-white" expand="lg">
      <Container>
        <Navbar.Brand as={Link} to="/">
          <img src={logo} alt='logo' className="icon-placeholder-logo"/>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link as={Link} to="/catalog">Каталог</Nav.Link>
            <Nav.Link as={Link} to="/about">О нас</Nav.Link>
            <Nav.Link as={Link} to="/profile">Личный кабинет</Nav.Link>
          </Nav>
          <Nav>
            <Nav.Link as={Link} to="/cart">
              Корзина <img src={basket} alt='корзина' className="icon-placeholder"/>
            </Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

const Header = () => {
  return <MainHeader />;
};

export default Header;
